import { PlusOutlined } from '@ant-design/icons';
import {
  PageContainer,
  ProTable,
  ModalForm,
  ProFormText,
  ProFormSelect,
} from '@ant-design/pro-components';
import { Button, message, Popconfirm, Tag } from 'antd';
import { useState, useRef } from 'react';
import type { ActionType, ProColumns } from '@ant-design/pro-components';
import { getUserList, createUser, updateUser, deleteUser, type UserItem } from '@/services/user';
import { getAllRoles } from '@/services/role';

const UserPage: React.FC = () => {
  const actionRef = useRef<ActionType>();
  const [modalOpen, setModalOpen] = useState(false);
  const [currentRow, setCurrentRow] = useState<UserItem>();

  const columns: ProColumns<UserItem>[] = [
    { title: '', dataIndex: 'username', width: 120 },
    { title: '', dataIndex: 'nickname', width: 120 },
    { title: '', dataIndex: 'email', width: 180, search: false },
    { title: '', dataIndex: 'phone', width: 140, search: false },
    {
      title: '',
      dataIndex: 'status',
      width: 80,
      search: false,
      render: (_, record) => (
        <Tag color={record.status === 1 ? 'green' : 'red'}>
          {record.status === 1 ? '' : ''}
        </Tag>
      ),
    },
    { title: '', dataIndex: 'createTime', width: 180, search: false },
    {
      title: '',
      width: 150,
      valueType: 'option',
      render: (_, record) => [
        <a key="edit" onClick={() => { setCurrentRow(record); setModalOpen(true); }}>

        </a>,
        <Popconfirm
          key="delete"
          title=""
          onConfirm={async () => {
            await deleteUser(record.id);
            message.success('');
            actionRef.current?.reload();
          }}
        >
          <a style={{ color: '#ff4d4f' }}></a>
        </Popconfirm>,
      ],
    },
  ];

  return (
    <PageContainer>
      <ProTable<UserItem>
        actionRef={actionRef}
        columns={columns}
        rowKey="id"
        request={async (params) => {
          const res = await getUserList({
            current: params.current,
            pageSize: params.pageSize,
            username: params.username,
          });
          return { data: res.list, total: res.total, success: true };
        }}
        toolBarRender={() => [
          <Button
            key="add"
            type="primary"
            icon={<PlusOutlined />}
            onClick={() => { setCurrentRow(undefined); setModalOpen(true); }}
          >

          </Button>,
        ]}
      />
      <ModalForm
        title={currentRow ? '' : ''}
        open={modalOpen}
        onOpenChange={setModalOpen}
        initialValues={currentRow}
        onFinish={async (values) => {
          if (currentRow) {
            await updateUser(currentRow.id, values);
          } else {
            await createUser(values);
          }
          message.success('');
          setModalOpen(false);
          actionRef.current?.reload();
          return true;
        }}
      >
        <ProFormText name="username" label="" rules={[{ required: true }]} />
        <ProFormText name="nickname" label="" rules={[{ required: true }]} />
        {!currentRow && (
          <ProFormText.Password name="password" label="" rules={[{ required: true }]} />
        )}
        <ProFormText name="email" label="" />
        <ProFormText name="phone" label="" />
        <ProFormSelect
          name="roleIds"
          label=""
          mode="multiple"
          request={async () => {
            const roles = await getAllRoles();
            return roles.map((r) => ({ label: r.name, value: r.id }));
          }}
        />
      </ModalForm>
    </PageContainer>
  );
};

export default UserPage;

