import { PlusOutlined } from '@ant-design/icons';
import {
  PageContainer,
  ProTable,
  ModalForm,
  ProFormText,
  ProFormDigit,
  ProFormTreeSelect,
  ProFormRadio,
} from '@ant-design/pro-components';
import { Button, message, Popconfirm } from 'antd';
import { useState, useRef } from 'react';
import type { ActionType, ProColumns } from '@ant-design/pro-components';
import { getMenuList, createMenu, updateMenu, deleteMenu } from '@/services/menu';
import type { MenuItem } from '@/types/menu';

// 
interface MenuModalProps {
  open: boolean;
  onOpenChange: (open: boolean) => void;
  currentRow?: MenuItem;
  menuList: MenuItem[];
  onSuccess: () => void;
}

const MenuModal: React.FC<MenuModalProps> = ({
  open, onOpenChange, currentRow, menuList, onSuccess,
}) => {
  const convertToTreeData = (menus: MenuItem[]): any[] => {
    return menus
      .filter((m) => m.type !== 2)
      .map((m) => ({
        value: m.id,
        title: m.name,
        children: m.children ? convertToTreeData(m.children) : undefined,
      }));
  };

  return (
    <ModalForm
      title={currentRow ? '' : ''}
      open={open}
      onOpenChange={onOpenChange}
      initialValues={currentRow || { type: 1, visible: 1, sort: 0 }}
      onFinish={async (values) => {
        if (currentRow) {
          await updateMenu(currentRow.id, values);
        } else {
          await createMenu(values);
        }
        message.success('');
        onOpenChange(false);
        onSuccess();
        return true;
      }}
    >
      <ProFormTreeSelect
        name="parentId"
        label=""
        allowClear
        fieldProps={{
          treeData: [{ value: 0, title: '' }, ...convertToTreeData(menuList)],
        }}
      />
      <ProFormRadio.Group
        name="type"
        label=""
        options={[
          { label: '', value: 0 },
          { label: '', value: 1 },
          { label: '', value: 2 },
        ]}
      />
      <ProFormText name="name" label="" rules={[{ required: true }]} />
      <ProFormText name="path" label="" />
      <ProFormText name="icon" label="" />
      <ProFormText name="permission" label="" />
      <ProFormDigit name="sort" label="" min={0} />
      <ProFormRadio.Group
        name="visible"
        label=""
        options={[
          { label: '', value: 1 },
          { label: '', value: 0 },
        ]}
      />
    </ModalForm>
  );
};

const MenuPage: React.FC = () => {
  const actionRef = useRef<ActionType>();
  const [modalOpen, setModalOpen] = useState(false);
  const [currentRow, setCurrentRow] = useState<MenuItem>();
  const [menuList, setMenuList] = useState<MenuItem[]>([]);

  const columns: ProColumns<MenuItem>[] = [
    { title: '', dataIndex: 'name', width: 200 },
    { title: '', dataIndex: 'path', width: 200 },
    { title: '', dataIndex: 'icon', width: 100 },
    {
      title: '',
      dataIndex: 'type',
      width: 100,
      valueEnum: { 0: '', 1: '', 2: '' },
    },
    { title: '', dataIndex: 'sort', width: 80 },
    {
      title: '',
      dataIndex: 'visible',
      width: 80,
      valueEnum: { 1: { text: '', status: 'Success' }, 0: { text: '', status: 'Error' } },
    },
  ];

  return (
    <PageContainer>
      <ProTable<MenuItem>
        actionRef={actionRef}
        columns={[
          ...columns,
          {
            title: '',
            width: 150,
            valueType: 'option',
            render: (_, record) => [
              <a key="edit" onClick={() => { setCurrentRow(record); setModalOpen(true); }}>

              </a>,
              <Popconfirm
                key="delete"
                title=""
                onConfirm={async () => {
                  await deleteMenu(record.id);
                  message.success('');
                  actionRef.current?.reload();
                }}
              >
                <a style={{ color: '#ff4d4f' }}></a>
              </Popconfirm>,
            ],
          },
        ]}
        rowKey="id"
        search={false}
        pagination={false}
        request={async () => {
          const data = await getMenuList();
          setMenuList(data);
          return { data, success: true };
        }}
        toolBarRender={() => [
          <Button
            key="add"
            type="primary"
            icon={<PlusOutlined />}
            onClick={() => { setCurrentRow(undefined); setModalOpen(true); }}
          >

          </Button>,
        ]}
      />
      <MenuModal
        open={modalOpen}
        onOpenChange={setModalOpen}
        currentRow={currentRow}
        menuList={menuList}
        onSuccess={() => actionRef.current?.reload()}
      />
    </PageContainer>
  );
};

export default MenuPage;
